import React, { Component } from "react";
import { Container, Row, Col } from 'react-bootstrap';
import QualityInfo from './QualityInfo.jsx';

import featureSelection from '../images/FeatureSelectionResults.png';
import logerrorFitted from '../images/Fitted_graph.png';
import meanSqErr from '../images/mean_square_error.png';
// import Overview from '../images/FeatureSelectionResults.png';
import QQplot from '../images/QQPlot.png';

class Quality extends Component {
  render() {
    return (
      <Container className="text-center" fluid>
        <Row style={{ marginTop: "50px" }}>
          <Col >
            <QualityInfo title={"Basic Overview"} desc={"Four"} image={null} />
          </Col>
          <Col>
            <QualityInfo title={"QQ Plot"} desc={"Five"} image={QQplot} />
          </Col>
        </Row>
        <Row className="justify-content-space-evenly" style={{ marginTop: "50px" }}>
          <Col>
            <QualityInfo title={"Log-error"} desc={"Two"} image={logerrorFitted} />
          </Col>
          <Col>
            <QualityInfo title={"Mean-square error"} desc={"Three"} image={meanSqErr} />
          </Col>
        </Row>
        <Row style={{ marginTop: "50px" }}>
          <Col>
            <QualityInfo title={"Feature Selection"} desc={"One"} image={featureSelection} />
          </Col>
        </Row>
      </Container>
    );
  }
}

export default Quality;
